current.custom_css:
html{
padding-bottom: 0!important;
}
ul.menu-vertical li:nth-child(n+12) {
display: none;
}
header {
box-shadow: 0 2px 10px rgba(0, 0, 0, .05);
z-index: 3;
}
.cta.design_7 {
border-bottom: 1px solid #444;
}
.cta.design_7 .form-control {
border-radius: 3px;
}
button.single_add_to_cart_button,
button.single_add_to_cart_button i{
font-weight: 600;
}
button.single_add_to_cart_button i{
margin-top: -.2rem;
}
@media (min-width: 320px) and (max-width: 575px){
.grid-item.col-xs-6 {
-ms-flex: 0 0 100%;
flex: 0 0 100%;
max-width: 100%;
}
}
@media (min-width: 576px) and (max-width: 767px){
.grid-item.col-sm-4 {
-ms-flex: 0 0 50%;
flex: 0 0 50%;
max-width: 50%;
}
}
#preview-bar-iframe{
display: none;
}
.shop-top {
position: static;
}
.swiper-slide {
height: auto;
}
@media (min-width: 1430px){
:root {
    --max-container: 1400px;
}
}

current.xl_custom_css:
.header.style-08 .header-bottom .header-control {
    -ms-flex: 0 0 20%;
    flex: 0 0 20%;
    max-width: 20%;
}
.header.style-08 .header-logo.order-1, .header.style-08 .header-control.order-3 {
    -ms-flex: 0 0 20%;
    flex: 0 0 20%;
    max-width: 20%;
}
.header.style-08 .header-control.order-lg-2 {
    -ms-flex: 0 0 60%;
    flex: 0 0 60%;
    max-width: 60%;
}
.cta.design_7 .col-lg-4 {
-ms-flex: 0 0 33.333333%;
flex: 0 0 33.333333%;
max-width: 33.333333%;
margin-left: 8.333333%;
}
.cta.design_7 .col-xl-7 {
-ms-flex: 0 0 50%;
flex: 0 0 50%;
max-width: 50%;
}

settings.css_section:
.section_id .slideshow__title{
  font-size: 1.3rem;
  letter-spacing: .01em;
  margin-bottom: .5rem;
text-transform: uppercase;
}
.section_id .slideshow__subtitle{
  color: #333;
  font-size: 4rem;
  line-height: 1.2;
  letter-spacing: -.03em;
  margin-bottom: 1.2rem;
}
.section_id .slideshow__description{
  color: #333333;
  font-size: 3.5rem;
  line-height: 1.2;
  letter-spacing: -.025em;
  margin-bottom: 1rem;
}
.section_id .slideshow__description sup{
  font-size: 2rem;
  top: -.7em;
  font-weight: 400;
}
.section_id .btn{
  font-weight: 600;
}
@media screen and (min-width: 768px){
.section_id .slideshow__description{
  font-size: 4rem;
}
}
